import { useState } from "react";

export default function RegisterUMKM() {
  const [form, setForm] = useState({
    nama_usaha: "",
    nama_pemilik: "",
    email: "",
    username: "",
    password: "",
    password_confirmation: "",
  });

  const handleChange = (e) => {
    setForm(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Payload lengkap + role umkm
    const payload = { ...form, role: "umkm" };

    try {
      const res = await fetch("http://localhost:8000/api/register", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload),
      });

      const data = await res.json();

      if (!res.ok) {
        alert("Error: " + JSON.stringify(data.errors || data.message));
      } else {
        alert("Registrasi UMKM berhasil! Silakan login.");
        setForm({
          nama_usaha: "",
          nama_pemilik: "",
          email: "",
          username: "",
          password: "",
          password_confirmation: "",
        });
      }
    } catch (error) {
      alert("Gagal terkoneksi ke server");
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-giCream px-6 py-12 pt-24">
      <div className="bg-white shadow-lg rounded-xl p-8 w-full max-w-lg">
        <h2 className="text-3xl font-bold mb-8 text-center text-giGreen">
          Registrasi UMKM
        </h2>
        <form className="space-y-5" onSubmit={handleSubmit}>
          {/* Nama UMKM */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">
              Nama UMKM / Usaha
            </label>
            <input
              name="nama_usaha"
              type="text"
              value={form.nama_usaha}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Masukkan nama usaha"
              required
            />
          </div>

          {/* Nama Pemilik */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">
              Nama Pemilik / Penanggung Jawab
            </label>
            <input
              name="nama_pemilik"
              type="text"
              value={form.nama_pemilik}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Masukkan nama pemilik"
              required
            />
          </div>

          {/* Email */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">Email</label>
            <input
              name="email"
              type="email"
              value={form.email}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Masukkan email"
              required
            />
          </div>

          {/* Username */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">
              Username
            </label>
            <input
              name="username"
              type="text"
              value={form.username}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Masukkan username"
              required
            />
          </div>

          {/* Password */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">
              Password
            </label>
            <input
              name="password"
              type="password"
              value={form.password}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Masukkan password"
              required
            />
          </div>

          {/* Konfirmasi Password */}
          <div>
            <label className="block text-giGreen font-semibold mb-2">
              Konfirmasi Password
            </label>
            <input
              name="password_confirmation"
              type="password"
              value={form.password_confirmation}
              onChange={handleChange}
              className="w-full px-4 py-2 rounded border border-gray-300 focus:ring-2 focus:ring-giGreen focus:outline-none"
              placeholder="Konfirmasi password"
              required
            />
          </div>

          {/* Button */}
          <button
            type="submit"
            className="w-full bg-giGreen text-white py-3 rounded font-semibold hover:bg-green-700 transition"
          >
            Daftar
          </button>

          {/* Link Login */}
          <p className="text-center text-sm text-gray-600 mt-4">
            Sudah punya akun?{" "}
            <a href="/login" className="text-giGreen font-semibold hover:underline">
              Masuk di sini
            </a>
          </p>
        </form>
      </div>
    </div>
  );
}
